import * as React from "react";
import logo from "../../logo.svg";
import "./Navbar.css";
import { Navbar, Container, Nav } from "react-bootstrap";
import { overviewEN, overviewTH, overviewDE } from "../Data/DataLanguage";
import { Link } from "react-router-dom";

const navbarHome = (props) => {
  const { innerWidth: width } = window;
  const you = props.languages;
  const pathname = window.location.pathname;

  const promotion = (x) => {
    if (x === 1) {
      window.scrollTo(0, 500);
    } else {
      window.scrollTo(0, 1250);
    }
  };

  const gologin = () => {
    const navigate = props?.navigate;
    navigate("/Login");
  };

  React.useEffect(() =>
{
  window.scrollTo(0, 0);
}, [])

  return (
    <Navbar
      expand="lg"
      style={{ transition: "initial", boxShadow: "none", position: "initial" }}
    >
      <Container fluid style={{ backgroundColor: "transparent" }}>
        <Navbar.Brand href="/">
          <div style={{ left: "40%", position: "relative" }}>
            <img src={logo} alt="Logo" />
          </div>
        </Navbar.Brand>

        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          {you === "English" ? (
            <>
              <div className="dd" style={{ left: "30%" }}>
                <div className="NavLi">
                  <p
                    style={{ fontWeight: "bold", fontSize: 24, lineHeight: 28 }}
                  >
                    {overviewEN[0].label}
                  </p>
                </div>
                {pathname === "/" ? (
                  <div
                    className="NavLi"
                    style={{ color: "black" }}
                    onClick={() => promotion(2)}
                  >
                    <p>{overviewEN[1].label}</p>
                  </div>
                ) : (
                  <div
                    className="NavLi"
                    style={{ color: "black" }}
                    // onClick={() => promotion(2)}
                  >
                    <Link
                      to="/"
                      style={{
                        fontSize: 18,
                        lineHeight: 21,
                        textDecorationLine: "none",
                        color: "black",
                      }}
                    >
                      {overviewEN[1].label}
                    </Link>
                  </div>
                )}
                <div
                  className="NavLi"
                  // onClick={() => promotion(1)}
                  style={{ color: "black" }}
                >
                  <p>{overviewEN[2].label}</p>
                </div>

                {pathname === "/" ? (
                  <div
                    className="NavLi"
                    style={{ color: "black" }}
                    onClick={() => promotion(1)}
